COVID-19 was unleashed onto the world by China. 
&nbsp;
@SpeakerPelosi now sides with Communist China by calling it the "Trump Virus."

Nancy, we’re both old enough to know what I mean when I say you’ve officially “jumped the shark.”

It is alarming that @YouTube now relies on the @WHO’s biased recommendations to decide what video content to take down.
&nbsp;
The @WHO gave inaccurate information about the spread of the virus, still parrots Chinese propaganda, and fought @realDonaldTrump’s China travel ban.

It’s time to hold Beijing accountable. 

The Stop COVID Act will allow Americans to sue Communist China and seek compensation if they suffered harm resulting from the regime’s role in spreading this virus.
@Lancegooden

OPINION | China must be held accountable for the coronavirus pandemic.

China must be called out and any attempts to attack or criticise people for referring to COVID-19 as a “Chinese virus” should be pushed back on.

@couriermail #auspol

How did @realDonaldTrump fail to contain #coronavirus?
1. By focusing on China, he failed to stop the virus coming in from other countries;
2. By focusing on foreign nationals, he failed to stop virus carried by US travelers;
3. By not testing, he let the virus spread undetected.
